import React from 'react'



class SubmitButton extends React.Component{


    constructor(){

        super()

        this.value = {
          value: ""
        }

    }

    handleSubmit(e){
      e.preventdefault();


      this.setState({
        value: e.target.value
      })
    }


    render(){


        return(
            <div>
                <button>
                    Submit
                 </button>
            </div>
        )
    }

}
export default SubmitButton
